script: |
  super -f text -I q12041.spq | sort > q12041.out

inputs:
  - name: q12041.spq
    data: |
      SELECT ALL + 29 + - 68 / - 79 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 = - col1 * - col0 + - 62 + + col1 / - 52;
  - name: tab1

outputs:
  - name: q12041.out
    data: |
      29
      29
      29
